import React from 'react';

import NowWeatherScraper from './NowWeatherScraper';

export default function Search() {
    return (
        <React.Fragment>
            <input className='input'></input>
            <button onClick={() => {
                <NowWeatherScraper city={document.querySelector('input').value} />
            }}>Отправить</button>
        </React.Fragment>
    )
}
